    <a href={{ path('login') }}>Login</a>
    <a href={{ path('registration') }}>Register</a>
    {% endif %}

    {% if is_granted(\"ROLE_USER\") %}
    <a href={{ path('logout') }}>Déconnexion</a>
    <a href={{ path('app_annonce_new_annonce') }}>Recherche Joueurs</a>
    {% endif %}

    {% if is_granted(\"ROLE_ADMIN\") %}
